import React, { useState, useEffect } from 'react';
import axios from 'axios';

const OrderHistory = (props) => {
    const [data, setData] = useState([]);
    const userId = props.userId; // assuming you get userId as a prop or you can get it from context or other methods.

    useEffect(() => {
        axios.get(`http://localhost:4000/orderhistory/${userId}`)
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, [userId]);

  return (
    <div style={{ margin: '20px' }}>
      <h2>Order History</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>Booking ID</th>
            <th>Booking Start Date</th>
            <th>Booking End Date</th>
            <th>Customer Name</th>
            <th>Total Price</th>
            <th>Details</th>
          </tr>
        </thead>
        <tbody>
          {data.map(order => (
            <tr key={order.BookingId}>
              <td>{order.BookingId}</td>
              <td>{order.BookingStartDate}</td>
              <td>{order.BookingEndDate}</td>
              <td>{order.CustFirstName} {order.CustLastName}</td>
              <td>${order.TotalPrice}</td>
              <td>
                {/* You can add more detailed view or a link to a detailed page */}
                <button>View Details</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrderHistory;
